css:
:host {
  background-color: #262626;
  color: #d3d0c8;
}
:host {
  background-color: #262626;
  color: #d3d0c8;
}
:host .wrap-guide {
  background-color: #282a2e;
}
:host .indent-guide {
  color: #373b41;
}
:host .invisible-character {
  color: #373b41;
}
:host .gutter {
  background-color: #262626;
  border-right: 1px solid #282a2e;
  color: #d3d0c8;
}
:host .gutter .line-number {
  padding: 0 0.25em 0 0.5em;
}
:host .gutter .line-number.cursor-line {
  background-color: #96B5B4;
  color: white;
}
:host .gutter .line-number.cursor-line-no-selection {
  color: white;
}
:host .gutter .line-number.folded,
:host .gutter .line-number:after,
:host .fold-marker:after {
  color: #969896;
}
:host .scroll-view {
  padding-left: 10px;
}
:host .invisible {
  color: #d3d0c8;
}
:host .cursor {
  color: white;
}
:host .selection .region {
  background-color: #515151;
}
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
:host .search-results .marker.current-result .region {
  border: 1px solid white;
}
.comment {
  color: #969896;
}
.entity.name.type {
  color: #EBCB8B;
  text-decoration: none;
}
.entity.other.inherited-class {
  color: #A3BE8C;
}
.keyword {
  color: #B48EAD;
}
.keyword.control {
  color: #B48EAD;
}
.keyword.operator {
  color: #d3d0c8;
}
.keyword.other.special-method {
  color: #96B5B4;
}
.keyword.other.unit {
  color: #D08770;
}
.storage {
  color: #B48EAD;
}
.constant {
  color: #D08770;
}
.constant.character.escape {
  color: #96B5A6;
}
.constant.numeric {
  color: #D08770;
}
.constant.other.color {
  color: #96B5A6;
}
.constant.other.symbol {
  color: #A3BE8C;
}
.variable {
  color: #BF616A;
}
.variable.interpolation {
  color: #a3685a;
}
.variable.parameter.function {
  color: #d3d0c8;
}
.invalid.illegal {
  background-color: #BF616A;
  color: #262626;
}
.string {
  color: #A3BE8C;
}
.string.regexp {
  color: #96B5A6;
}
.string.regexp .source.ruby.embedded {
  color: #FF8000;
}
.string.other.link {
  color: #BF616A;
}
.punctuation.definition.comment {
  color: #969896;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #d3d0c8;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #96B5B4;
}
.punctuation.definition.bold {
  color: #EBCB8B;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #B48EAD;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #a3685a;
}
.support.class {
  color: #EBCB8B;
}
.support.function {
  color: #96B5A6;
}
.support.function.any-method {
  color: #96B5B4;
}
.entity.name.function {
  color: #96B5B4;
}
.entity.name.class,
.entity.name.type.class {
  color: #EBCB8B;
}
.entity.name.section {
  color: #96B5B4;
}
.entity.name.tag {
  color: #BF616A;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #D08770;
}
.entity.other.attribute-name.id {
  color: #96B5B4;
}
.meta.class {
  color: #EBCB8B;
}
.meta.link {
  color: #D08770;
}
.meta.require {
  color: #96B5B4;
}
.meta.selector {
  color: #B48EAD;
}
.meta.separator {
  background-color: #373b41;
  color: #d3d0c8;
}
.none {
  color: #d3d0c8;
}
.markup.bold {
  color: #D08770;
  font-weight: bold;
}
.markup.changed {
  color: #B48EAD;
}
.markup.deleted {
  color: #BF616A;
}
.markup.italic {
  color: #B48EAD;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #96B5B4;
}
.markup.inserted {
  color: #A3BE8C;
}
.markup.list {
  color: #BF616A;
}
.markup.quote {
  color: #D08770;
}
.markup.raw.inline {
  color: #A3BE8C;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #BF616A;
}
:host.mini .scroll-view {
  padding-left: 1px;
}
